@main def dayThree2022: Unit = {
  val initTime = System.currentTimeMillis
  println("Welcome to day three of the Advent of Code!")
  val duplicateScore = DayThree.calculateTotalScoreOfDuplicateValues(input)
  println("The duplicate score of the rucksacks is " + duplicateScore)
  val badgeValues = DayThree.calculateBadgeValues(input)
  println("The badge values is " + badgeValues)
  val elapsedTime = System.currentTimeMillis-initTime
  println("This took " + elapsedTime + " milliseconds")
}


object DayThree {
  def calculateTotalScoreOfDuplicateValues(rucksackList: List[String]): Int = {
    val duplicateList = rucksackList.map(findTheOnlyElementThatIsInBothHalvesOfARucksack(_))
    val scoreList = duplicateList.map(calculateCharValue(_))
    scoreList.sum
  }

  def calculateBadgeValues(rucksackList: List[String]): Int = {
    val groups = splitIntoElfGroups(rucksackList)
    val badges = groups.map(findTheOnlyElementThatIsInTheThreeRucksacks(_))
    badges.map(DayThree.calculateCharValue(_)).sum
  }

  def calculateCharValue(char: Char): Int = {
    if (char.isUpper) char.toInt - 38 else char.toInt - 96
  }

  def findTheOnlyElementThatIsInBothHalvesOfARucksack(rucksack: String): Char = {
    val rucksackHalves = splitRucksackInHalves(rucksack)
    val firstHalf: List[Char] = rucksackHalves._1.distinct.toList
    val secondHalf: String = rucksackHalves._2
    whatAreTheDuplicateElements(firstHalf, secondHalf).head
  }

  def whatAreTheDuplicateElements(firstRucksack: List[Char], secondRucksack: String): List[Char] = {
    firstRucksack.map(elementIsInOtherRucksack(_, secondRucksack)).filter(_ != '0')
  }

  def elementIsInOtherRucksack(element: Char, otherRucksackHalf: String): Char = {
    if (otherRucksackHalf.contains(element))
      element
    else '0'
  }

  def splitRucksackInHalves(rucksack: String): (String, String) = {
    rucksack.splitAt(rucksack.length / 2)
  }

  def splitIntoElfGroups(rucksackList: List[String]) = {
    rucksackList.grouped(3).toList
  }

  def findTheOnlyElementThatIsInTheThreeRucksacks(rucksackGroup: List[String]): Char = {
    val firstRuckSack: List[Char] = rucksackGroup(0).distinct.toList
    val secondRuckSack: String = rucksackGroup(1)
    val thirdRuckSack: String = rucksackGroup(2)
    val duplicateElementsFirstTwo = DayThree.whatAreTheDuplicateElements(firstRuckSack, secondRuckSack)
    DayThree.whatAreTheDuplicateElements(duplicateElementsFirstTwo, thirdRuckSack).head
  }
}


